import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <nav className="flex flex-row justify-between items-center h-20 max-w-6xl">
          <NavLink to="/">
            <div className="ml-5">
              <img src="" alt=""/>
            </div>
          </NavLink>

          <div className="flex items-center font-medium text-slate-100 mr-5">
            <NavLink to="/">
              <p>Home</p>
            </NavLink>
            
            <NavLink to="/cart">
              <div>
                <FaShoppingCart/>
              </div>
            </NavLink>
          </div>
      </nav>
    </div>
  );
};

export default Navbar;
